import React, { useState } from "react";
import "./Modal.css";

function InvoiceModal({ isOpen, toggleModal }) {
  const [showTooltip, setShowTooltip] = useState(false);
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });

  // State variables for form fields
  const [paymentDate, setPaymentDate] = useState("");
  const [description, setDescription] = useState("");
  const [price, setPrice] = useState("");
  const [supplierId, setSupplierId] = useState("");
  const [file, setFile] = useState(null);

  // Reset form fields when modal is closed
  if (!isOpen) return null;

  // Function to handle mouse position for tooltip
  const handleMouseMove = (e) => {
    setMousePosition({ x: e.clientX, y: e.clientY });
  };

  // Handle file input change
  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  // Function to handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();

    // Prepare form data
    const formData = new FormData();
    formData.append("paymentDate", paymentDate);
    formData.append("description", description);
    formData.append("price", price);
    formData.append("supplierId", supplierId);
    if (file) formData.append("file", file); // Add file only if selected

    // Send data to backend
    fetch("http://localhost:3003/api/invoices", {
      method: "POST",
      body: formData, // Send form data directly
    })
      .then((response) => {
        if (!response.ok) {
          throw new Error("Chyba pri odosielaní faktúry.");
        }
        return response.json();
      })
      .then((data) => {
        console.log("Faktúra úspešne odoslaná:", data);
        // Clear form fields and close modal
        setPaymentDate("");
        setDescription("");
        setPrice("");
        setSupplierId("");
        setFile(null);
        toggleModal();
      })
      .catch((error) => {
        console.error("Error:", error);
        alert("Nastala chyba pri odosielaní faktúry. Skúste to znova.");
      });
  };

  return (
    <div className="modal-overlay" onClick={toggleModal}>
      <div
        className="modal-content faktury-modal"
        onClick={(e) => e.stopPropagation()} // Prevents modal close on inner click
      >
        <h2>Pridať uhradenú faktúru</h2>
        <form onSubmit={handleSubmit}>
          <label>
            Dátum úhrady
            <input
              type="date"
              value={paymentDate}
              onChange={(e) => setPaymentDate(e.target.value)}
              className="input-date"
            />
          </label>
          <label>
            <input
              type="text"
              placeholder="Popis"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              className="input-description"
            />
          </label>
          <label>
            <input
              type="number"
              placeholder="Cena"
              value={price}
              onChange={(e) => setPrice(e.target.value)}
              min="0"
              className="input-price"
            />
          </label>
          <label>
            <input
              type="text"
              placeholder="IČO dodávateľa"
              value={supplierId}
              onChange={(e) => setSupplierId(e.target.value)}
              className="input-supplier-id"
            />
          </label>

          <div className="button-container">
            <label
              htmlFor="file-upload"
              className="custom-upload-button"
              onMouseEnter={() => setShowTooltip(true)}
              onMouseLeave={() => setShowTooltip(false)}
              onMouseMove={handleMouseMove}
            >
              <img src="./Upload.svg" alt="Upload Icon" className="upload-icon" />
              {showTooltip && (
                <span
                  className="tooltip"
                  style={{
                    top: mousePosition.y + 15,
                    left: mousePosition.x + 15,
                  }}
                >
                  Pridaj fotku faktúry
                </span>
              )}
            </label>

            {/* Hidden file input for file upload */}
            <input
              type="file"
              id="file-upload"
              className="input-upload"
              style={{ display: "none" }}
              onChange={handleFileChange}
            />

            <button type="submit" className="submit-btn">
              Odošli
            </button>
          </div>
        </form>

        <button className="close-btn" onClick={toggleModal}>
          X
        </button>
      </div>
    </div>
  );
}

export default InvoiceModal;
